import axios from "axios";
const API_KEY = process.env.REACT_APP_SUBSCRIPTION_KEY;

export const checkPatientDetails = (nhsNumber) => {
  const url = `https://cors-anywhere.herokuapp.com/https://al-tech-test-apim.azure-api.net/tech-test/t2/patients/${nhsNumber}`;
  return axios
    .get(url, {
      headers: {
        "Ocp-Apim-Subscription-Key": API_KEY,
      },
    })
    .catch((e) => {
      console.log(e, "!!!!!");
    });
};
